(function($,Drupal,once){Drupal.behaviors.webformWizardPagesLink={attach:function(context){$(once('webform-wizard-pages-links','.js-webform-wizard-pages-links',context)).each(function(){var $pages=$(this);var $form=$pages.closest('form');var hasProgressLink=$pages.data('wizard-progress-link');var hasPreviewLink=$pages.data('wizard-preview-link');$pages.find('.js-webform-wizard-pages-link').each(function(){var $button=$(this);var title=$button.attr('title');var page=$button.data('webform-page');if(hasProgressLink){var $progress=$form.find('.webform-progress [data-webform-page="'+page+'"]');$progress.find('.progress-marker, .progress-title, .webform-progress-bar__page-title').attr({'role':'link','title':title,'aria-label':title,'tabindex':'0'}).on('click',function(){$button.trigger('click')}).on('keydown',function(event){if(event.which===13){$button.trigger('click')}});$progress.find('.progress-marker, .webform-progress-bar__page-title').attr('tabindex',0)}
if(hasPreviewLink){$form.find('.webform-preview [data-webform-page="'+page+'"]').append($button).show()}})})}}})(jQuery,Drupal,once)